import React, {Component} from 'react';

interface Props {
    type: string,
    text: string, 
    options: {}
};

class InfoSection extends Component<Props> {
    render() {
        const {type, text, options} = this.props;

        return (
            <div>
                <h4>{type}</h4>
            </div>
        );
    };
}

export default InfoSection;
